import React from 'react';
import { Box, Container, Paper, Typography, Link } from '@mui/material';
import { Link as RouterLink } from 'react-router-dom';
import AuthForm from '../components/AuthForm';
import '../styles/neumorphic.css';

const Login = () => {
  return (
    <Box
      sx={{
        display: 'flex',
        flexDirection: 'column',
        minHeight: '100vh',
        backgroundColor: 'background.default',
        alignItems: 'center',
        justifyContent: 'center',
      }}
    >
      <Container maxWidth="sm" className="neumorphic-container">
        <div className="neumorphic-card" style={{ width: '100%', maxWidth: 500, padding: '32px' }}>
          <Typography component="h1" variant="h4" gutterBottom>
            Biometric Authentication
          </Typography>
          <Typography variant="body2" color="textSecondary" align="center" sx={{ mb: 3 }}>
            Secure login with multi-factor biometric verification
          </Typography>

          <AuthForm />
          <Box sx={{ mt: 2, textAlign: 'center' }}>
            <Typography variant="body2">
              Don't have an account?{' '}
              <Link component={RouterLink} to="/register" underline="hover" sx={{ color: 'var(--accent-color)' }}>
                Sign up here
              </Link>
            </Typography>
          </Box>
        </div>
      </Container>
    </Box>
  );
};

export default Login;
